import { Header } from "./components/Header";
import './style/app.css'
import { Menu } from "./components/Menu"; 
import { BrowserRouter, Route, Routes } from "react-router-dom";
import io from 'socket.io-client'
import { useContext, useEffect, useState } from "react";
import { Login } from "./components/Login";
import { CrearSector } from "./components/CrearSector";
import { CrearCargo } from "./components/CrearCargo";
import { CrearProducto } from "./components/CrearProducto";
import { TransaccionesPen } from "./components/TransaccionesPen";
import { Transacciones } from "./components/Transacciones";
import { Conversiones } from "./components/Conversiones";
import { Inventario } from "./components/Inventario";
import { UserContext } from "./context/user";
import { AdministrarCuentas } from "./components/AdministrarCuentas";

function App() {

  const socket = io('http://192.168.1.34:5000')
  const [usuarios , setUsuarios] = useState([])

  const [sectores,setSectores] = useState([])
  const [cargos,setCargos] = useState([])
  const [productos,setProductos] = useState([])
  const [transacciones,setTransacciones] = useState([])
  const [transaccionesPen,setTransaccionesPen] = useState([])
  const [conversiones,setConversiones] = useState([])

  useEffect(()=>{
    GetUser()
    GetSectores()
    GetProductos()
    GetCargos()
    GetTransacciones()
    GetTransaccionesPen()
    GetConversiones()

    socket.on('cambiosUser',()=>{
      GetUser()
    })

    socket.on('cambiosSectores',()=>{
      GetSectores()
    })

    socket.on('cambiosProductos',()=>{
      GetProductos()
    })

    socket.on('cambiosCargos',()=>{
      GetCargos()
    })

    socket.on('cambiosTransacciones',()=>{
      GetTransacciones()
      GetTransaccionesPen()
    })

    socket.on('cambiosConversiones',()=>{
      GetConversiones()
    })

  },[])

  function GetUser(){
    socket.emit('getUsuarios')
    socket.on('putUsuarios',(usuarios)=>{
      setUsuarios(usuarios)
      console.log(usuarios)
    })
  }

  function GetProductos(){
    socket.emit('getProductos')
    socket.on('putProductos',(productos)=>{
      setProductos(productos)
      // console.log(productos)
    })
  }

  function GetTransacciones(){
    socket.emit('getTransacciones')
    socket.on('putTransacciones',(Transacciones)=>{
      setTransacciones(Transacciones)
      // console.log(Transacciones)
    })
  }

  function GetTransaccionesPen(){
    socket.emit('getTransaccionesPen')
    socket.on('putTransaccionesPen',(TransaccionesPen)=>{
      setTransaccionesPen(TransaccionesPen)
      console.log(TransaccionesPen)
    })
  }

  function GetSectores(){
    socket.emit('getSectores')
    socket.on('putSectores',(sectores)=>{
      setSectores(sectores)
      // console.log(sectores)
    })
  }

  function GetCargos(){
    socket.emit('getCargos')
    socket.on('putCargos',(cargos)=>{
      setCargos(cargos)
      console.log(cargos)
    })
  }

  function GetConversiones(){
    socket.emit('getConversiones')
    socket.on('putConversiones',(conversiones)=>{
      setConversiones(conversiones)
      console.log(conversiones,'converciones')
    })
  }

  return (
    <BrowserRouter>
      <Header/>
      <Routes>
        <Route path="/" element={<Login usuarios={usuarios}/>}/>
        <Route path="/Menu/:idusuario" element={<Menu usuarios={usuarios}/>}/>
        <Route path="/CrearCuenta" element={<AdministrarCuentas usuarios={usuarios} cargos={cargos} socket={socket}/>}/>
        <Route path="/CrearSector" element={<CrearSector socket={socket}/>}/>
        <Route path="/CrearCargo" element={<CrearCargo socket={socket}/>}/>
        <Route path="/CrearProducto" element={<CrearProducto socket={socket} sectores={sectores}/>}/>
        <Route path="/TransaccionesPen" element={<TransaccionesPen socket={socket} transacciones_pen={transaccionesPen} usuarios={usuarios} sectores={sectores} productos={productos}/>}/>
        <Route path="/Transacciones" element={<Transacciones socket={socket} transacciones={transacciones} usuarios={usuarios} sectores={sectores} productos={productos}/>}/>
        <Route path="/Conversiones" element={<Conversiones socket={socket} conversiones={conversiones} usuarios={usuarios} productos={productos}/>}/>
        <Route path="/Inventario" element={<Inventario socket={socket} usuarios={usuarios} sectores={sectores} productos={productos}/>}/>
      </Routes>
    </BrowserRouter>
  );
}


export default App;
